(207, 6, 2, '346465|Taxable Goods|Réchaud de camping à deux brûleurs|Pr&ecirc;t &nbsp; pour les grands espaces? Ce r&eacute;chaud de camping &agrave; deux br&ucirc;leurs est id&eacute;al pour &nbsp; cuisiner &agrave; l&rsquo;ext&eacute;rieur. 2 &nbsp; br&ucirc;leurs en acier inoxydable de 10 000 BTU chacun, 20 000 BTU en tout&nbsp;&nbsp;&nbsp; Surface de cuisson &agrave; aire ouverte de 508 cm2&nbsp; &nbsp;&nbsp;&nbsp; Couvercle &eacute;maill&eacute; noir &agrave; charni&egrave;re avec pare-vent rabattables&nbsp;&nbsp;&nbsp; Chambre de cuisson &eacute;maill&eacute;e noire&nbsp;&nbsp;&nbsp; Grille de cuisson chrom&eacute;e&nbsp;&nbsp;&nbsp; 2 boutons de commande en nylon renforc&eacute; de fibre de verre&nbsp;&nbsp;&nbsp; 2 pattes &agrave; blocage repliables en m&eacute;tal&nbsp;&nbsp;&nbsp; Bouteille de propane non comprise&nbsp;&nbsp;&nbsp; Dimensions du produit assembl&eacute; : l 36.50 cm x P 7.00 cm x L 55.50 cm x p 0.43 grams|Prêt pour les grands espaces? Ce réchaud de camping à deux brûleurs est idéal pour cuisiner à l’extérieur|48.99|1'),
