(68, 4, 72, 0, 6, '<div class="wgrid-4w4 wgrid-4w8 wgrid-6w12 marg-l-0 description">\r\n<p>Pr&ecirc;t &nbsp; pour les grands espaces? Ce r&eacute;chaud de camping &agrave; deux br&ucirc;leurs est id&eacute;al pour &nbsp; cuisiner &agrave; l&rsquo;ext&eacute;rieur.</p>\r\n</div>\r\n<div class="wgrid-4w4 wgrid-4w8 wgrid-6w12 marg-r-0 bullets">\r\n<ul>\r\n<li>2 &nbsp; br&ucirc;leurs en acier inoxydable de 10 000 BTU chacun, 20 000 BTU en tout&nbsp;&nbsp;&nbsp;</li>\r\n<li>Surface de cuisson &agrave; aire ouverte de 508 cm2&nbsp; &nbsp;&nbsp;&nbsp;</li>\r\n<li>Couvercle &eacute;maill&eacute; noir &agrave; charni&egrave;re avec pare-vent rabattables&nbsp;&nbsp;&nbsp;</li>\r\n<li>Chambre de cuisson &eacute;maill&eacute;e noire&nbsp;&nbsp;&nbsp;</li>\r\n<li>Grille de cuisson chrom&eacute;e&nbsp;&nbsp;&nbsp;</li>\r\n<li>2 boutons de commande en nylon renforc&eacute; de fibre de verre&nbsp;&nbsp;&nbsp;</li>\r\n<li>2 pattes &agrave; blocage repliables en m&eacute;tal&nbsp;&nbsp;&nbsp;</li>\r\n<li>Bouteille de propane non comprise&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n<p>Dimensions du produit assembl&eacute; : l 36.50 cm x P 7.00 cm x L 55.50 cm x p 0.43 grams</p>\r\n</div>'),
(69, 4, 73, 0, 6, 'Prêt pour les grands espaces? Ce réchaud de camping à deux brûleurs est idéal pour cuisiner à l’extérieur'),
(70, 4, 83, 0, 6, NULL),
(71, 4, 106, 0, 6, NULL),
(74, 4, 72, 1, 6, '<div class="wgrid-4w4 wgrid-4w8 wgrid-6w12 marg-l-0 description">\r\n<div class="wgrid-4w4 wgrid-4w8 wgrid-6w12 marg-l-0 description">\r\n<p>Heading outdoors?&nbsp; This convenient two burner &nbsp; camp stove is just the addition you need to make your meal time complete.</p>\r\n</div>\r\n<div class="wgrid-4w4 wgrid-4w8 wgrid-6w12 marg-r-0 bullets">\r\n<ul>\r\n<li>2 &nbsp; stainless steel 10,000 BTU burners,total of 20,000 BTUs&nbsp;&nbsp;&nbsp;</li>\r\n<li>200 square inches open area cooking surface&nbsp;&nbsp;&nbsp;</li>\r\n<li>Black enamel hinged top lid with foldout windgaurds&nbsp;&nbsp;&nbsp;</li>\r\n<li>Black enamel firebox&nbsp;&nbsp;&nbsp;</li>\r\n<li>Chrome plated cooking grid&nbsp;&nbsp;&nbsp;</li>\r\n<li>2 nylon fiberglass reinforced control knobs&nbsp;&nbsp;&nbsp;</li>\r\n<li>2 wire locking folding legs&nbsp;&nbsp;&nbsp;</li>\r\n<li>Propane tank not included</li>\r\n</ul>\r\n<p>Assembled product dimensions: L 36.50 cm x W 7.00 cm x H 55.50 cm x W 0.43 grams</p>\r\n</div>\r\n</div>'),
(75, 4, 73, 1, 6, 'Heading outdoors?  This convenient two burner camp stove is just the addition you need to make your meal time complete.'),
(78, 4, 72, 0, 7, '<div class="wgrid-4w4 wgrid-4w8 wgrid-6w12 marg-l-0 description">\r\n<p><b>Ensemble de cuisine de camping</b></p>\r\n</div>\r\n<div class="wgrid-4w4 wgrid-4w8 wgrid-6w12 marg-r-0 bullets">\r\n<ul>\r\n<li>Ensemble de cuisine de camping pour 1 personne</li>\r\n<li>Comprend 5 Pi&egrave;ces&nbsp;<br />- Marmite: 560 ml<br />- Po&ecirc;le &agrave; frire 1: 19 cm<br />- Po&ecirc;le &agrave; frire 2: 17,8 cm<br />- Grande tasse: 205 ml</li>\r\n<li>Facile &agrave; transporter</li>\r\n<li>Chauffe et refroidit facilement</li>\r\n<li>Aluminium poli brillant</li>\r\n</ul>\r\n<p>Dimensions du produit assembl&eacute; : l 20.10 cm x P 7.90 cm x L 18.80 cm x p 245.00 grams</p>\r\n</div>'),
(79, 4, 73, 0, 7, 'Ensemble de cuisine de camping'),
