(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '\n<div class="page-title"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class="disc">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class="disc">\n            <li><a href="#" onclick="history.go(-1); return false;">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a>\n            <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n', '2015-03-12 12:53:58', '2015-03-12 12:53:58', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 'About Us', 'two_columns_right', NULL, NULL, 'about', NULL, '<div class="page-title">\r\n<h1>About the store LesFousDuSport</h1>\r\n</div>\r\n<div class="col2-set">\r\n<div class="col-1">\r\n<p><strong style="color: #de036f;">Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobortis. Nulla nec velit.</strong></p>\r\n<p style="text-align: justify;">Vivamus tortor nisl, lobortis in, faucibus et, tempus at, dui. Nunc risus. Proin scelerisque augue. Nam ullamcorper. Phasellus id massa. Pellentesque nisl. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Nunc augue. Aenean sed justo non leo vehicula laoreet. Praesent ipsum libero, auctor ac, tempus nec, tempor nec, justo.</p>\r\n<p style="text-align: justify;">Maecenas ullamcorper, odio vel tempus egestas, dui orci faucibus orci, sit amet aliquet lectus dolor et quam. Pellentesque consequat luctus purus. Nunc et risus. Etiam a nibh. Phasellus dignissim metus eget nisi. Vestibulum sapien dolor, aliquet nec, porta ac, malesuada a, libero. Praesent feugiat purus eget est. Nulla facilisi. Vestibulum tincidunt sapien eu velit. Mauris purus. Maecenas eget mauris eu orci accumsan feugiat. Pellentesque eget velit. Nunc tincidunt.</p>\r\n<p style="text-align: justify;">Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobortis. Nulla nec velit. Mauris pulvinar erat non massa. Suspendisse tortor turpis, porta nec, tempus vitae, iaculis semper, pede. Cras vel libero id lectus rhoncus porta. Suspendisse convallis felis ac enim. Vivamus tortor nisl, lobortis in, faucibus et, tempus at, dui. Nunc risus. Proin scelerisque augue. Nam ullamcorper</p>\r\n<p><strong style="color: #de036f;">Maecenas ullamcorper, odio vel tempus egestas, dui orci faucibus orci, sit amet aliquet lectus dolor et quam. Pellentesque consequat luctus purus.</strong></p>\r\n<p>Nunc et risus. Etiam a nibh. Phasellus dignissim metus eget nisi.</p>\r\n<div class="divider">&nbsp;</div>\r\n<p>To all of you, from all of us at Magento Store - Thank you and Happy eCommerce!</p>\r\n<p style="line-height: 1.2em;"><strong style="font: italic 2em Georgia, serif;">John Doe</strong><br /> <small>Some important guy</small></p>\r\n</div>\r\n<div class="col-2">\r\n<p><strong style="color: #de036f;">In reality ...</strong></p>\r\n<p>LesFousDuSport is a fictitious online store created in a computer science course. Please do not perform transactions. About this, "Dortalomu" is a fictional sporting brand.</p>\r\n<p style="color: #888888; font-style: normal; font-variant: normal; font-weight: normal; font-stretch: normal; font-size: 1.2em; line-height: 1.4em; font-family: georgia, serif; text-align: justify;">The challenge was to have a high rank on search engines (Google) with the keyword "Dortalomu". Initially, it gave no search results. Through various ways, we had to show first in search results.</p>\r\n<p>To achieve this challenge , we have adopted a strategy on the following points&nbsp;:</p>\r\n<ul>\r\n<li>Having quality content</li>\r\n<li>Have a presence on social networks</li>\r\n<li>Having a bilingual site</li>\r\n</ul>\r\n<p style="text-align: justify;">To this end, we have created a line of products called "Dortalomu." In this way, it was possible to use the word "Dortalomu" in several ways. We used it in our product names, in discussion forums, in our descriptions as well as our page titles.</p>\r\n<p style="text-align: justify;">Then we had a very important presence on Facebook. On April 8th, we had about 370 people who had liked our page. We also had a Twitter account, a Google+ account and a Pinterest account.</p>\r\n<p style="text-align: justify;">Finally, design a bilingual site has achieved a wider audience.</p>\r\n<div class="divider">&nbsp;</div>\r\n<p>Thank you for you participation.<br /><a title="ici" href="blogdusportif/nous-avons-a-coeur-votre-opinion/" target="_blank">Share you opinion about our store</a></p>\r\n<p style="line-height: 1.2em;"><strong style="font: italic 2em Georgia, serif;">Team LesFousDuSport</strong><br /> <small>A devoted team</small></p>\r\n</div>\r\n</div>', '2015-03-12 12:53:58', '2015-04-09 00:13:51', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
