(1, 4, 'order', 'new_order', 'cebf2bc74866185e3b5a67869d7f7d80', '\r\n\r\n\r\n\r\n<body style="background:#F0F0F0; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\r\n<div style="background:#F0F0F0; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="100%">\r\n<tr>\r\n    <td align="center" valign="top" style="padding:20px 0 20px 0">\r\n        <!-- [ header starts here] -->\r\n        <table bgcolor="#FFFFFF" cellspacing="0" cellpadding="10" border="0" width="650" style="border:1px solid #E0E0E0;">\r\n            <tr>\r\n                <td valign="top"><a href="http://lesfousdusport.com/"><img src="http://lesfousdusport.com/media/email/logo/default/1511577_356856937844243_984646028699725060_n.png" alt="Dortalomu - Boutique de sport" style="margin-bottom:10px;" border="0"/></a></td>\r\n            </tr>\r\n        <!-- [ middle starts here] -->\r\n            <tr>\r\n                <td valign="top">\r\n                    <h1 style="font-size:22px; font-weight:normal; line-height:22px; margin:0 0 11px 0;">Bonjour, Jean Grondin</h1>\r\n                    <p style="font-size:12px; line-height:16px; margin:0 0 10px 0;">\r\n                <span style="font-size:12px; line-height:16px; margin:0;">Merci d''avoir passé commande sur  Dortalomu - Boutique de sport.<br/>Nous vous enverrons prochainement un lien de suivi pour votre colis lorsqu''il sera expédié.</span></p>\r\n                  <p style="font-size:12px; line-height:16px; margin:0;">Si vous avez des questions au sujet de votre commande, n''hésitez pas à nous contacter sur <a href="mailto:contact@lesfousdusport.com" style="color:#1E7EC8;">contact@lesfousdusport.com</a> ou bien appelez-nous au <span class="nobr"></span> du lundi au vendredi, de 9h  à 18h. </p>\r\n                    <p align="center" style="font-size:12px; line-height:16px; margin:0;"><br>\r\n              